import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <>
      <div className='content'>
        <Routes>
        <Route path="/.components/Home" element={<Home />} />
        </Routes>
      </div>
      </>
    </Router>
  );
}

export default App;
